import React from "react";
import {useEffect, useState} from "react";
import axios from "axios";
import TextField from '@mui/material/TextField';

const App = () => {

    return(
        <div>
        <div class="grid">
            <div class="inline_grid"><p>Username:</p></div>
            <div class="inline_grid"><p>Email:</p></div>
            <div class="inline_grid"><p>Organization:</p></div>
            <div class="inline_grid"><p>Address:</p></div>
            <div class="inline_grid"><p>City:</p></div>
            <div class="inline_grid"><p>State:</p></div>
            <div class="inline_grid"><p>Country:</p></div>
            <div class="inline_grid"><p>Postal Code:</p></div>
        </div>
        <div class="grid">
            <div class="inline_grid"><p>Username:</p></div>
            <div class="inline_grid"><p>Email:</p></div>
