            <div class="inline_grid"><p>Address:</p></div>
            <div class="inline_grid"><p>City:</p></div>
            <div class="inline_grid"><p>State:</p></div>
            <div class="inline_grid"><p>Country:</p></div>
            <div class="inline_grid"><p>Postal Code:</p></div>
        </div>

        </div>
    );
};

export default App;
